import React from 'react'

const Rating = ({ value, text }) => {
  return (
    <div>
      <span
        className={
          value >= 1
            ? 'fas fa-star'
            : value >= 0.5
            ? 'fas fa-star-half-alt'
            : 'far fa-star'
        }
      >
        Hello
      </span>
    </div>
  )
}

export default Rating
